import React, { Component } from 'react'

export class Bezitting extends Component {
   
    divStyleHuis = {
        color: 'blue'
    };


    render() {
        return (
            this.props.items.map((item) => 
            <div key= {item.id} style={this.divStyleHuis}>
                 <p>{item.id}</p>
                 <p>{item.bezitting}</p>
                 <p>{item.waarde}</p>
            </div>
            )
        )
    }
}


export default Bezitting
